import React from 'react';
import EditIcon from '@material-ui/icons/Edit';

const EditButton = ({ setShowForm }) => {
  const handleClick = () => {
    setShowForm(true);
  };
  return (
    <div>
      <button onClick={handleClick}>
        <EditIcon />
      </button>
    </div>
  );
};

export default EditButton;
